  const { id } = useParams();

  const [event, setEvent] = useState()

  useEffect(() => {
    async function fetchResults() {
      
      try {
        const response = await userService.get("events", id);

        if (response.data.items) {

          console.log(response.items)
          
        }
      } catch (e) {
        console.log(e);
      }
    }

    fetchResults();
  }, [id]);

  return <div>event</div>;
};

